import Header from "./components/Navbar/Navbar";
import Footer from "./components/Footer/Footer";

function App() {
  return (
    <div className="App">
      <Header />
      <main className="main-content">
        <h1>Este es el contenido principal</h1>
      </main>
      <Footer />
    </div>
  );
}

export default App;
